	conbinemessage: function(length,bytes,version,flag,serviceID,commandID,seq,reversed){
        var buffer = new ArrayBuffer(length);
        var dv = new DataView(buffer);
        //设置头信息
        dv.setInt32(0,length,false);
        dv.setUint16(4,version,false);
        dv.setUint16(6,flag,false);
        dv.setUint16(8,serviceID,false);
        dv.setUint16(10,commandID,false);
        dv.setUint16(12,seq,false);
        dv.setUint16(14,reversed,false);
        var m_body = new Uint8Array(buffer,16);
        for (var i = 0; i < bytes.byteLength; i++) {
            m_body[i] = bytes[i];
        }
        return buffer;
	},
	setparams : function(serviceID,commandID,bytes){
        var seq = chat.datas.seq_num;
        chat.datas.seq_num = seq+1;//消息包序号递增1
        if(bytes&&bytes!=undefined){
        	var length = bytes.byteLength+16;
        } else {
        	var bytes = 0;length = 16;
        }  
		var buffer = chat.conbinemessage(length,bytes,1,chat.config.flag,serviceID,commandID,seq,0);
		chat.wsSend(buffer,serviceID,commandID);
	},
